    .main__container {
      padding: 20px 15px;

      color: #fff;

    }

      font-weight: 400;

    }

      position: relative;

      justify-content: center;

    }

    }

      height: 6em;

    }

      left: 0;
      right: 0;

    }

      margin: .1em
    }

    .video__wControl>div {
      margin: 0 .25em
    }

    .video__controlProgress {
      background-color: hsla(0, 0%, 100%, .2);
      height: 6px;
      position: relative;
      flex-grow: 1;
      border-radius: 3px;
      overflow: hidden
    }

    .video__controlProgress:before {
      background-color: #d0021b;
      content: '';
      height: 100%;
      left: 0;
      position: absolute;
      top: 0;
      width: 20%
    }

    .video__controlInfo {
      float: left;
      font-family: sans-serif;
      font-size: 12px
    }

    .video__controlIc {
      fill: #fff;
      height: 2em;
      width: 2em
    }

        padding: calc(15px + (20 - 15) * ((100vw - 320px)/ (550 - 320))) 15px
      }

        width: calc(36px + (45 - 36) * ((100vw - 320px)/ (550 - 320)))
      }
    }
